import "../style/cart.css"


const Cart = () => {

    return (  
        <>
            <header>
                <div></div> className="continue-shopping">
                <img src="./images/arrow.png" alt="arrow" className="arrow-icon" />
                <h3>Continue Shopping</h3>

            </header>
            <div className="cart-icon">
                <img src="./images/cart.png" alt=""  />

            </div>
        </>
    );
}
 
export default Cart;
